import React, { useEffect, useRef } from 'react';

const PlayerProfile = () => {
  const abilityBarsRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            const bars = entry.target.querySelectorAll('.ability-fill');
            bars.forEach((bar, index) => {
              setTimeout(() => {
                bar.style.width = bar.dataset.level + '%';
              }, index * 200);
            });
          }
        });
      },
      { threshold: 0.5 }
    );

    if (abilityBarsRef.current) {
      observer.observe(abilityBarsRef.current);
    }

    return () => observer.disconnect();
  }, []);

  return (
    <section id="about" className="game-section">
      <h2 className="section-title">About Me</h2>
      <div className="character-sheet">
        <div className="stat-block">
          <div className="character-description">
            <p>
              "The greater the obstacle, the more glory in overcoming it." - Moli√®re
            </p>
            <p>
              I'm a passionate Senior Game Developer with over 5 years of experience in Unity, C#, AR/VR, and multiplayer game development. 
              My journey in the gaming industry has been driven by a deep love for creating immersive experiences that connect people.
            </p>
            <p>
              I specialize in Unity development, AR/VR technologies, and multiplayer game systems. My expertise includes 
              performance optimization, cross-platform development, and creating engaging user experiences that keep players coming back.
            </p>
            <p>
              When I'm not coding, you'll find me exploring the latest in AR/VR technology, contributing to open-source projects, 
              or sharing knowledge with the developer community. I believe in continuous learning and pushing the boundaries of what's possible in game development.
            </p>
          </div>

          <div className="ability-bars" ref={abilityBarsRef}>
            <div className="ability">
              <span>Unity Development</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="95" style={{ width: '0%' }}></div>
              </div>
            </div>
            <div className="ability">
              <span>C# Programming</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="92" style={{ width: '0%' }}></div>
              </div>
            </div>
            <div className="ability">
              <span>AR/VR Development</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="88" style={{ width: '0%' }}></div>
              </div>
            </div>
            <div className="ability">
              <span>Multiplayer Systems</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="85" style={{ width: '0%' }}></div>
              </div>
            </div>
            <div className="ability">
              <span>Performance Optimization</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="90" style={{ width: '0%' }}></div>
              </div>
            </div>
            <div className="ability">
              <span>Game Design</span>
              <div className="ability-bar">
                <div className="ability-fill" data-level="82" style={{ width: '0%' }}></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default PlayerProfile;
